import { useNavigate } from "react-router-dom";
import logo from "../images/bc-logo-white.png"
import classes from "../styles/Footer.module.css";

export default function Footer() {
  // const navigate = useNavigate();

  return(
    <div>
      <div className={classes.footer}>
        <div className={classes.col1} >
          <img src={logo}/>
        </div>
        <div className={col2}>
          <p className={classes.footerTitle}>Braving Counseling with Vicki, LLC</p>
          <p className={`${classes.address}${classes.robotoRegular}`}>115 NE 7th Ave, Suite 103; Gainesville, FL 32601</p>
          {/* <p className="address roboto-regular"></p> */}
          <p className={`${classes.email} ${classes.handlee-regular}`}><i className="fa-regular fa-envelope" /> vicki@fakeemail.com</p>
          <p className={`${phone} ${handlee-regular}`}><i className="fa-solid fa-mobile-screen" /> (352) 290-2038</p>
        </div>
        <div className={col3}></div>
      </div>
    </div>
  )
}
